import FormLogIn from "./FormLogIn";

const LogIn = ({ login }) => {
    return (
        <div className="login">
            <div className="container col-md-6 offset-md-3 col-lg-4 offset-lg-4">
                <h3 className="mb-3" style={{
                    fontWeight: "bold", color: "white"
                }}>Log In</h3>
                <FormLogIn login={login} />
            </div>
        </div>
    )
}

export default LogIn;
